import React, { Component } from "react";
import "../css/bootstrap.min.css";
function Output(props) {
  return "Sistem Informasi " + props.nama;
}
export class Header extends Component {
  render() {
    return (
      <div className='container'>
        <Output nama='E-Biz' />
      </div>
    );
  }
}

export default Header;
